import React from 'react'
import { useSelector } from 'react-redux'

export default function Demo7_Users() {

    const users = useSelector(state=>state.users)
    
    const usersRep = users.map(user => 
        {
            return (<li key={user.id}>{user.name}</li>)
        })
    return (
        <div>
            <h3>Users</h3>
            <ul>
                {usersRep}
            </ul>
        </div>
    )
}
